import React from 'react'
import './Hero.css'
import profile_img from '../../assets/profile_img.svg'

const Hero = () => {
  return (
    <div className='hero'>
        <img src={profile_img} alt="" />
        <h1>O'm Prasiddha Jung K.C., fullstack developer based in Nepal.</h1>
        <p>I am a fullstack developer from Nepalgunj, Nepal currently studying BSc CSIT in Patan Multiple Campus, </p>
    </div>
  )
}

export default Hero
